import { GOOGLE_SIGN_IN_START, SET_CURRENT_USER } from './user-types';

export const setCurrentUser = (user) => {
  return {
    type: SET_CURRENT_USER,
    payload: user,
  };
};

export const googleSignInStart = () => {
  return {
    type: GOOGLE_SIGN_IN_START,
  };
};
